import React from "react";
import logo from "./logo.svg";
import "./App.css";
import InpuTextComponent from "./components/input_component";

function App() {
	return (
		<div className="App">
			<header className="App-header">
				<img src={logo} className="App-logo" alt="logo" />
				<h2>Search a city</h2>
				<div className="input-container">
					<InpuTextComponent />
				</div>
			</header>
		</div>
	);
}

export default App;
